   function between(x, from, to) {
	x = (x - from) / (to - from);
	if (x > 1) {
		x = 1;
	}
	if (x < 0) {
		x = 0;
	}
	
	return x;
  }
  
  function findPoints(data, width, height) {
      for (var x = 0; x < width; x++) {
	      data[x][0] = 0;
		  data[x][height - 1] = 0;
	  }
	  for (var y = 0; y < height; y++) {
	      data[0][y] = 0;
		  data[width - 1][y] = 0;
	  }
	  
      var results = [];
      for (var x = width - 2; x > 0; x--) {
	      for (var y = height - 2; y > 0; y--) {
		      if (data[x][y] > 0) {
			      var points = [[x, y]];
				  var sumX = 0;
				  var sumY = 0;
				  var sum = 0;
				  var count = 0;
				  
				  for(var i = 0; points[i]; i++) {
				      var px = points[i][0];
					  var py = points[i][1];
					  val = data[px][py];
					  if (val > 0) {
						  sumX += px * val;
						  sumY += py * val;
						  sum += val;
						  count += 1;
						  data[px][py] = 0;
						  for(var j = -1; j < 2; j++) {
							  for(var k = -1; k < 2; k++) {
								  if (data[px+j][py+k] > 0) {
									points.push([px+j, py+k]);
								  }
							  }
						  }
					  }
                  }

                  results.push({
                    x: sumX / sum,
					y: sumY / sum,
					avg: sum / count,
					count: count,
					sum: sum
                  });				  
			  }
		  }
	  }
	  
	  results.sort(function(a, b) {
	    return b.sum - a.sum;
	  });
	  
	  return results;
  }
  
  function getPosition() {
    var start = new Date();
    var context = snapshot.getContext('2d');
    context.drawImage(player, 0, 0, snapshotCanvas.width, snapshotCanvas.height);
	
	var width = snapshot.width;
	var height = snapshot.height;
	var data = [];
	for (var i = 0; i < width; i++) {
	  data[i] = [];
	};
    var image = context.getImageData(0, 0, snapshot.width, snapshot.height);
	
	var timepoint = new Date();
    var thresh_red = 100;
    var thresh_green = 100;
    var thresh_blue = 100;

    var channels = image.data.length/4;
    for(var i=0;i<channels;i++){
        var r = image.data[i*4 + 0];
        var g = image.data[i*4 + 1];
        var b = image.data[i*4 + 2] ;

		var gg = between(g / (r + 1), 2.0, 2.3) * between(g / (b + 1), 1.3, 1.4) * between(g, 70, 90);
		var val = gg * 255;
		
		image.data[i*4 + 0] = val;
		image.data[i*4 + 1] = val;
		image.data[i*4 + 2] = val;
		data[i % width][Math.floor(i / width)] = gg;
    }
	
	var points = findPoints(data, width, height);
	var t3points = points.slice(0, 3);
	t3points.sort(function(p1, p2) { return p1.x - p2.x; });
	//console.log(t3points);
	var table = '<table>';
	
    context.putImageData(image, 0,  0);
	
	var dist = t3points[2].x - t3points[0].x;
	
	var maxdist = 295;
	var mindist = 163;
	var py = 1 - between(1/dist, 1/maxdist, 1/mindist);
	var px = between(t3points[1].x, t3points[0].x, t3points[2].x);
	px = between(px, 0.085, 0.915);
	
		//table += '<tr><td>' + dist + '</td><td>' + x + '</td><td> px: ' + px + '</td><td> py: ' + py + '</td></tr>';
	//document.getElementById('output').innerHTML = table + '</table>';
	
	return {
	  x: px,
	  y: py
    }
  }

          var x = lastPoint.x - prevPoint.x;
          var y = lastPoint.y - prevPoint.y;
          var length = Math.sqrt(x * x + y * y);
          path.push({x: lastPoint.x + x / length * 0.07, y: lastPoint.y + y / length * 0.07, accuracy : 0.07});		  
	  }
	  
	  if (options.brushPull) {
	      
	  }
	  
      console.clear();
      driving = true;
	  prevPosition = null;
	  resetCounter = 0;
	  drivePath_(path, callback, options);
  }
  
  function ps() {
      driving = false;
  }
  
  function p() {
      paused = !paused;
  }
  
  var speeds = [{x:0, y:0, time:0}];
  
  function getImp() {
    var delay = 1000;
	var speed = 0.1 / 1000.0;
	var now = +(new Date());
	var ts = now - delay;
	var prevTime = now;
	var i = 0;
	var result = {x:0, y:0};
	var timePassed = 0;
	while(speeds[i].time > ts) {
	    timePassed = prevTime - speeds[i].time;
		result.x += timePassed * speed * speeds[i].x;
		result.y += timePassed * speed * speeds[i].y;
		prevTime = speeds[i].time;
		i++;
	}
	
	timePassed = prevTime - ts;
	result.x += timePassed * speed * speeds[i].x;
	result.y += timePassed * speed * speeds[i].y;
	
	return result;
  }
  
  function distance(pointA, pointB) {
      return Math.sqrt((pointA.x - pointB.x) * (pointA.x - pointB.x) + (pointA.y - pointB.y) * (pointA.y - pointB.y));
  }
  
  function distPointToLine(point, lineA, lineB) {
      var med = {x: (lineA.x + lineB.x) / 2, y: (lineA.y + lineB.y) / 2}; 
  
      if (distance(lineA, lineB) < 0.001) {
          return distance(med, point);
      }
	  
	  if (distance(lineA, point) < distance(lineB, point)) {
	      return distPointToLine(point, lineA, med);
	  } else {
	      return distPointToLine(point, lineB, med);
	  }
  }
  
  function drivePath_(path, callback, options) {
    if (paused) {
	    SB.stopAll();
		speeds.unshift({x: 0, y: 0, time: +(new Date())});
	    setTimeout(function() { drivePath_(path, callback, options);}, 1000);
	    return null;
	}
  
    if (path.length && driving) {
	  try {
	  var position = getPosition();
	  } catch (error) {
	      console.error("position error");
	      setTimeout(function() {
	         drivePath_(path, callback, options);
          }, 50);
          return null;	  
	  }
	  var imp = getImp();
	  console.log(position, imp);
	  
	  position.x += imp.x;
	  position.y += imp.y;
	  
	  if (resetCounter === options.reset) {
	      resetCounter = -10;
	  }
	  
	  if (prevPosition === null) {
	     prevPosition = position;
	  }
	  
	  var nextPoint = path[0];
	  
	  if (resetCounter < 0) {
	      resetCounter += 1;
	      nextPoint = {x : 2, y: 2};
	  }
	  
	  var dx = nextPoint.x - position.x;
	  var dy = nextPoint.y - position.y
	  
	  var dist = Math.sqrt(dx * dx + dy * dy);
	  
	  if (dist < 0.15) {
	      resetCounter += 1;
	  }
	  
	  if (distPointToLine(nextPoint, prevPosition, position) < (nextPoint.accuracy || options.accuracy)) {
	    path.splice(0, 1);
		resetCounter = 0;
		drivePath_(path, callback, options);
		return;
	  }
	  
	  var dxd = dx > 0 ? SB.CCW : SB.CW;
      var dyd = dy > 0 ? SB.CW  : SB.CCW;
	  
	  var pw = between(dist, -0.05, 0.15);

      var dxp = between(pw * Math.abs(dx) / dist, -0.35, 0.9);
      //dxp = dxp > 0.2 ? dxp : 0; //cutting as giving less than 25% power dont make any sense in this case
      var dyp = between(pw * Math.abs(dy) / dist, -0.35, 0.9);
      //dyp = dyp > 0.2 ? dyp : 0;  //cutting as giving less than 25% power dont make any sense in this case
	  speeds.unshift({x: pw * dx / dist, y: pw * dy / dist, time: +(new Date())});
	  
	  console.log('pos x', position.x);
	  console.log('pos y', position.y);
	  
	  console.log('ds x', nextPoint.x);
	  console.log('ds y', nextPoint.y);
	  
	  console.log('dx p', dxp * (dx > 0 ? 1 : -1));
	  console.log('dy p', dyp * (dy > 0 ? 1 : -1));
       
	  SB.drive(SB.PORT3, dxd, Math.round(dxp * SB.MAX));
      SB.drive(SB.PORT2, dyd, Math.round(dyp * SB.MAX));	  
	   
      setTimeout(function() {
	    drivePath_(path, callback, options);
      }, 200);	
	} else {
	    SB.stopAll();
		speeds.unshift({x: 0, y: 0, time: +(new Date())});
		if (callback) {
            setTimeout(callback, 100);
        }		
	}
  }
  
  //drivePath([{x:0.1, y:0.1}, {x:0.9, y:0.1}, {x:0.9, y:0.9}, {x:0.1, y:0.1}, {x:0.5, y:0.3}, {x:0.7, y:0.7}, {x: 0.6, y: 0.1}]);
  //drivePath([{x:0.1, y:0.1}, {x:0.9, y:0.1}, {x:0.9, y:0.9}]);
  
  path1 = [];
  for(var i = 0; i < 100; i++) {
    path1.push({x: 0.5 +0.3*Math.sin(i/3), y: 0.5 + 0.3*Math.cos(i/3)});
  }
  
  function getColor(callback) {
  console.log('getColor');
      pen(1);
	  setTimeout(function() {
	      SB.drive(SB.PORT3, SB.CW, SB.MAX);
	      SB.drive(SB.PORT2, SB.CCW, SB.MAX);
		  
	      var waitForPt = function () {
		      var position = getPosition();
			  if (position.x + position.y < 0.05) {
			      SB.drive(SB.PORT3, SB.CW, 0);
	              SB.drive(SB.PORT2, SB.CCW, 0);
			      pen(-1);
				  setTimeout(function() {
			          pen(1);
					  if (callback) {
					      setTimeout(callback, 1200);
						  setTimeout(function() {
		                      pen(0);
		                  }, 1500);
					  }
				  }, 1700);
			  } else {
			      setTimeout(waitForPt, 200);
			  }
		  };
		  
		  waitForPt();
	  }, 1200);
  }
  
  function paint() {
    getColor(function() {
	   var path = lines[0].points;
	   lines.splice(0, 1);
	   var point = path[0];
	   path.splice(0, 1);
	   console.log('driving to pt');
	   drivePath([point], function() {
	       pen(-1);
		   setTimeout(function() {
		       console.log('drivePath');
		       drivePath(path, function() {
			       setTimeout(paint, 200);
			   }, {accuracy:0.03, extendLine:true});
		   }, 1250);
		   setTimeout(function() {
		       pen(0);
		   }, 2000);
	   }, {reset: 100});
	});
  }
  
  var power = 255;
  function addControls() {
    var ports = ['PORT1', 'PORT2', 'PORT3'];
	for(var i = 0; i < 3; i++) {
	  var port = ports[i];
	  var body = $('body');
	  var btn = $('<button>' + port + ' - </button>');
	  btn.click((function(port) {return function(){SB.drive(SB[port], SB.CW, power);}})(port));
	  body.append(btn); 
	  var btn = $('<button>' + port + ' + </button>');
	  btn.click((function(port) {return function(){SB.drive(SB[port], SB.CCW, power);}})(port));
	  body.append(btn); 
	  var btn = $('<button>' + port + ' 0 </button>');
	  btn.click((function(port) {return function(){SB.drive(SB[port], SB.CW, 0);}})(port));
	  body.append(btn); 
	  body.append('</br>');
	}
  }
  
  for(var i in lines) {
    for(k in lines[i].points) {
	    var p = lines[i].points[k];
		var s = p.x;
		p.x = p.y;
		p.y = s;
	}
  }
  
  lines = lines.filter(function(line) {
     var p1 = line.points[0];
	 var p2 = line.points[line.points.length - 1];
	 return ((p1.x - p2.x) * (p1.x - p2.x) + (p1.x - p2.x) * (p1.x - p2.x)) > 0.002;
  });
</script>
